pragma solidity ^0.5.0;

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";

contract ElectionV2 {
    using SafeMath for uint256;

    uint256 private electionIdCounter = 0; // will also serve as the election's key
    mapping (uint256 => Election) private electionList; // election id to election list
    uint256[] private electionKeyList;
    
    struct Election {
        uint256 keyIndex;
        string name;
    }

    function addElection(string memory name) private returns(uint256) {
        uint256 newKey = generateElectionId();
        electionList[newKey].name = name;
        electionList[newKey].keyIndex = electionKeyList.push(newKey) - 1;
    }

    function generateElectionId() private returns(uint256) {
        return ++electionIdCounter;
    }

    
}
